import React from 'react';

const Make = (props) => {
    return (
        <div className="option-container">
            {this.props.blackCar.drilldown.class_list.map(list => list.year_list.map(year => year.make_list.map(make => (<option className="option" onClick={this.props.handleOptionClick} key={make.name} value={make.name} name="make"> {make.name} </option> ))))}
        </div>
    )
}

export default connect(state => state, { getBlackModels }) (Make);

